miliares. Tanto en un caso como en el otro, nos centramos en trabajar exclusivamente con aquellas compañías que demuestran responsabilidad y compromiso en sus obligaciones contractuales. En base a los comentarios que hemos recibido de nuestros proveedores y clientes a lo largo de nuestra dilatada trayectoria, hemos llegado a la absoluta seguridad de que brindamos un servicio de primera categoría.</p>\r\n<p class=\"Estilo2\" align=\"justify\">Conocedores por décadas de las actividades económicas de nuestro país, nuestros contactos van más allá del sector pesquero (estamos centrados principalmente en harina y aceite de pescado y congelado) e incluyen segmentos de enorme consideración en la vida del Perú, como son la minería, fletamentos, energía, azúcar, café, sal marina y de mina, granos, legumbres, aceites, grasas y otros.</p>','Resumen','','publish','closed','closed','','resumen','','','2019-08-06 02:54:58','2019-08-06 02:54:58','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=17',0,'broker_seccion','',0),(18,1,'2019-08-06 01:57:24','2019-08-06 01:57:24','[:es]PERU BROKER se fundo y constituyo en lima, Perú, en febrero del año 1981, habiendo estado los accionistas y directivos relacionados con el comercio internacional de materias primas desde 1954.\r\n\r\nHoy actuamos como agentes representantes de compañías extranjeras y como comisionistas, para una diversa gama de productos. Además, hemos desarrollado a lo largo de los años, un departamento ágil y eficaz de “shipping” o agente de fletamentos, que facilita y economiza los embarques de nuestros proveedores.\r\n\r\nContamos con socios estratégicos en Europa, que cuentan con la misma experiencia además de un amplísimo número de clientes y proveedores; antiguos y nuevos, pero todos ellos de solvencia.\r\n\r\nEsta asociación estratégica con otra empresa europea de gran reconocimiento en el sector, Hispatrade SA, nos permite, por la diferencia de husos horarios, cubrir de manera adecuada y casi 24 horas diarias, los requerimientos de nuestros clientes asiáticos y los de otros continentes.\r\n\r\nEn PERU BROKER S.A. estamos muy al corriente de los requerimientos nutricionales y de las ventajas que tienen tanto la harina como el aceite de pescado, especialmente los de anchoveta peruana (engraulis ringens) en la elaboración de alimento para una amplia variedad de especies, y nunca perdiendo de vista la responsabilidad biológica de este recurso así como del medio ambiente marino básico en el desarrollo de esta actividad.[:]','[:es]Historia[:]','','publish','closed','closed','','historia','','','2019-09-20 01:55:27','2019-09-20 01:55:27','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=18',0,'broker_seccion','',0),(19,1,'2019-08-06 02:01:01','2019-08-06 02:01:01','[:es]Asistir a clientes y proveedores con una información imparcial, basada en hechos. Brindar igualmente las últimas novedades sobre las circunstancias del mercado y los factores que están influyendo en el mismo; los últimos precios tratados y su evolución en las últimas semanas.\r\n\r\nServir a los clientes interesados en la compra de productos, con los precios más económicos disponibles de proveedores de primer orden, sean grandes o pequeños, pero de probada seriedad y alta calidad.\r\n\r\nAtender a los clientes y proveedores con una ejecución muy profesionalizada de los contratos, siendo la rapidez, la precisión, la información, y la capacidad de resolver problemas que pudieran surgir en los embarques, nuestras principales cualidades y cartas en el servicio.\r\n\r\nEn resumen: servir a clientes y proveedores buscando su satisfacción.[:]','[:es]Objetivos[:]','','publish','closed','closed','','objetivos','','','2019-09-20 01:56:26','2019-09-20 01:56:26','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=19',0,'broker_seccion','',0),(20,1,'2019-08-06 02:03:18','2019-08-06 02:03:18','[:es]Estar alertas y adaptarnos a las nuevas circunstancias de la evolución de los mercados de materias primas, siempre teniendo presente que realizamos y cumplimos una función de ayuda y servicio tanto a los proveedores como a los clientes, labor que venimos realizando desde los inicios de PERU BROKER SA, ahorrando el tiempo en el proceso de compra y ejecución, pero también evitando el desgaste de una relación, cuando se presentan problemas.\r\n\r\nCabe mencionar que estamos desde ya totalmente involucrados en las nuevas tendencias de consumo humano, como los aceites de alto contenido de ácidos grasos Omega-3 y de las harinas especiales, procesadas mediante hidrólisis por fermentación, de más alta disponibilidad proteica.[:]','[:es]Idea a futuro[:]','','publish','closed','closed','','idea-a-futuro','','','2019-09-20 02:04:51','2019-09-20 02:04:51','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=20',0,'broker_seccion','',0),(21,1,'2019-08-06 02:05:44','2019-08-06 02:05:44','','[:es]Divisiones[:]','','publish','closed','closed','','divisiones','','','2019-09-23 12:58:15','2019-09-23 17:58:15','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=21',0,'broker_seccion','',0),(22,1,'2019-08-06 02:52:24','2019-08-06 02:52:24','','historia_logo_perubroker','','inherit','open','closed','','historia_logo_perubroker','','','2019-08-06 02:52:24','2019-08-06 02:52:24','',17,'http://www.perubroker.com.pe/wp-content/uploads/2019/08/historia_logo_perubroker.png',0,'attachment','image/png',0),(24,1,'2019-08-06 03:20:12','2019-08-06 03:20:12','Podemos dividir en dos las áreas de nuestra empresa:\n<ul>\n 	<li>CORRETAJE DE PRODUCTOS PROPIAMENTE DICHOS</li>\n</ul>\n&nbsp;\n\nFLETAMENTOS\n\n&nbsp;','Divisiones','','inherit','closed','closed','','21-autosave-v1','','','2019-08-06 03:20:12','2019-08-06 03:20:12','',21,'http://www.perubroker.com.pe/21-autosave-v1/',0,'revision','',0),(25,1,'2019-08-06 04:22:02','2019-08-06 04:22:02','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5